import React from "react";

const SoftwareDeveloper = props => {

  return (
    <div>
      <div>
        <label>Nome: </label>
        {props.name}
      </div>
      <div>
        <label>Cognome: </label>
        {props.surname}
      </div>
      <div>
        <label>Ruolo</label>
        {props.role}
      </div>
    </div>
  );
};

export default SoftwareDeveloper;
